import java.io.UnsupportedEncodingException;
import java.util.Base64;

class Groth16 {
    private static native boolean verify(byte[] vk, byte[] proof, byte[] inputs);

    static {
        System.loadLibrary("zwaves_jni");
    }

    public static void main(String[] args) {
        byte[] vk = Base64.getDecoder().decode("");
        byte[] proof = Base64.getDecoder().decode("grWmPlZQYPRN8o7g44rTY4jrbF/tyHp8JzYTWJNT+DW9OKLoI9H0tm9BMpyfIvnambTljNEinNBSNmihKVJDcxk/I4261EaxoLFomtbR3/KWfL7xqQCSzKQl5yu/TRLnEeVsNwu7S0UAKI+19BnfSVXhXzLmjgP/O5ERbEhRDZ2xx4VG8jkUEHCfzGlTZs+DgxmbBCosCqDfHd7wY73AZmZX3RC1qh+rz6DRvLwjMM3asBNhxBjIMnLcFBdH47zC");
        byte[] inputs = Base64.getDecoder().decode("AQAAAAAAAABW18M2czfaGMzIc/UcudeyiYC9fcPB4TDZAXnsBGmpEg==");

        assert Groth16.verify(vk, proof, inputs);

        byte[] wrongVk = Base64.getDecoder().decode("");
        byte[] wrongProof = Base64.getDecoder().decode("0rWmPlZQYPRN8o7g44rTY4jrbF/tyHp8JzYTWJNT+DW9OKLoI9H0tm9BMpyfIvnambTljNEinNBSNmihKVJDcxk/I4261EaxoLFomtbR3/KWfL7xqQCSzKQl5yu/TRLnEeVsNwu7S0UAKI+19BnfSVXhXzLmjgP/O5ERbEhRDZ2xx4VG8jkUEHCfzGlTZs+DgxmbBCosCqDfHd7wY73AZmZX3RC1qh+rz6DRvLwjMM3asBNhxBjIMnLcFBdH47zC");
        byte[] wrongInputs = Base64.getDecoder().decode("0QAAAAAAAABW18M2czfaGMzIc/UcudeyiYC9fcPB4TDZAXnsBGmpEg==");

        assert !Groth16.verify(wrongVk, proof, inputs);
        assert !Groth16.verify(vk, wrongProof, inputs);
        assert !Groth16.verify(vk, proof, wrongInputs);
    }
}